import React from "react";
import {
  Routes,
  Route,
  Link
} from "react-router-dom";

import Home from "./router/Home";
import About from "./router/About";

function App() {
    return (
        <Routes>
            <Route path="/">
                <Route path="/" component={Home} />
                <Route path="/about" component={About}></Route>
            </Route>
        </Routes>
    )
}

export default App;
